function checkServer() {
    axios.post("localhost:8080:check")
    .then((response) => {
        console.log(response);
    });
}

function Homepage() {
  return (

    <div className="HomepageDiv" style={{
        display: "flex", 
        justifyContent: "center",
        alignItems: "center"}}>
        <p>
          This is the LocSnap homepage!
        </p>
    </div>



  );
}

export default Homepage;
